        async Task<IEnumerable<EmployeeModel>> IEmployeeRepository.GetSearchData(EmployeeModel employeeModel)
        {
            return await Task.Run(() => {

                var data = this.EmployeeData();

                var searchData =
                            data
                            ?.AsEnumerable()
                            ?.Where((leEmployeeModel) => leEmployeeModel?.FirstName == employeeModel?.FirstName || leEmployeeModel?.LastName==employeeModel?.LastName || leEmployeeModel?.Department==employeeModel?.Department)
                            ?.ToList();
            
                return searchData;
            });
        }

        async Task<EmployeeModel> IEmployeeRepository.GetSingleEmployeeData(EmployeeModel employeeModel)
        {
            return await Task.Run(() => {

                var data = this.EmployeeData();

                var searchData =
                            data
                            ?.AsEnumerable()
                            ?.FirstOrDefault((leEmployeeModel) => leEmployeeModel?.Id == employeeModel?.Id);
                            

                return searchData;
            });
        }
